import React from "react";
import { useState } from "react";

let countryValue = "INDIA";

const Field = () => {
  const [val, setVal] = useState("");
  return (
    <>
      <input
        type="text"
        value={val}
        onChange={(e) => {
          setVal(e.target.value);
        }}
      />
      <button
        onSubmit={() => {
          countryValue = val;
        }}
      >
        Submit
      </button>
    </>
  );
};

export default Field;
export { countryValue };
